import React from "react";

const [xIsNext, setXIsNext] = useState(true);

const Square = ({ value, games, onClick }) => {
  setXIsNext(!xIsNext);
  return (
    <button
      className={"square " + (xIsNext ? "jedi" : "empire")}
      onClick={onClick}
    >
      {value}
    </button>
  );
};

export default Square;
